// CardsContainer, ResultCard and NoResultCard components
// card to hold a found place's search result details
import React from "react";
import "./style.css";

// ===================================================================
// cards CONTAINER
// ===================================================================

export function CardsContainer({ fluid, children }) {
  return (
    <div className="container" style={{ paddingTop: 20, paddingRight: 6, paddingLeft: 6, textAlign: "center" }}>
      {children}
    </div>
  );
}

// ===================================================================
// SEARCH RESULTS card
// ===================================================================

export function ResultCard({ children }) {
  return (
    <>
      <div className="card border-secondary mb-3">
        <div className="card-header text-primary p-0">
          <h5 style={{ display: "inline" }}>
            <a href={`https://www.google.com/search?q=Ensenada Mogotes`} target="_blank" style={{ color: "rgb(121, 27, 27)" }}>
              Ensenada Mogotes
              {/* ${card.featureName} */}
            </a>
            &nbsp;:&nbsp;
            <a href={`https://www.google.com/search?q=Argentina`} target="_blank" style={{ color: "rgb(29, 68, 126)" }}>
              Argentina
              {/* ${card.featureCountryName} */}
            </a>
          </h5>
        </div>
        <div className="card-body text-success p-0">
          <p>bottom content</p>
        </div>
      </div>
    </>
  );
}

// ===================================================================
// NO RESULTS card
// ===================================================================

export function NoResultCard({ children }) {
  return (
    <div
    // style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center" }}
    // className="jumbotron"
    >
      {children}
    </div>
  );
}
